import React from 'react';
import {GoogleApiWrapper, Map, MapProps} from 'google-maps-react';



const mapStyles = {
  position: 'absolute',
  top: '18px',
  left: '0px',
  width: '47.5%', // 47.5
  height: '85%',
  margin: '0',
  padding: '0'
};

const defaultCenter = {
  lat: 41.015137, lng: 28.979530
}

export default function MapContainer(){

  return (
     <LoadScript
       googleMapsApiKey=''>
        <GoogleMap
          mapContainerStyle={mapStyles}
          zoom={13}
          center={defaultCenter}
        />
     </LoadScript>
  )
}
